import { combineReducers } from "redux"

let authState = {
    isLoggedin: false,
    name: "",
    email: "",
    mobile: ""
}

let videosState = {
    searchHistory: [],
    videos: [],
    played: [],
    bookmarked: []
}

function authReducer(state = authState, action) {
    switch (action.type) {
        default:
            return state
    }
}
function videoReducer(state = videosState, action) {
    switch (action.type) {
        default:
            return state
    }
}

const rootReducers = combineReducers({
    auth: authReducer,
    video: videoReducer
})

export default rootReducers;
